import React, { Fragment } from 'react';
import Search from "./Search";
import '../assests/App.css';

function MyShow() {
  return (
    <Fragment>
        <button className="my-content">
          My Content
        </button>
        <h1>My Show</h1>
        <Search />
    </Fragment>
  );
}

export default MyShow;
